    t[15604] = "ExpressionBuilder.AnalyticalQueueingModels.ErlangC.Info";
    t[15605] = "<p>Berechnet eine Wartrschlangen-Kenngr\u00f6\u00dfe gem\u00e4\u00df des Erlang-C-Modells. Die Parameter haben dabei folgende Bedeutung:</p>\n<ol>\n  <li>Ankunftsrate &lambda;</li>\n  <li>Bedienrate &mu;</li>\n  <li>Warteabbruchrate &nu;</li>\n  <li>Anzahl an Bedienern c</li>\n  <li>Anzahl an Warte- und Bedienpl\u00e4tzen K</li>\n  <li>Ist der Parameter t&ge;0, so liefert die Funktion die Wahrscheinlichkeit, dass die Wartezeit h\u00f6chsten t betr\u00e4gt, d.h. den Service-Level P(W&le;t).\n  Ansonsten liefert die Funktion ein der folgenden Informationen:</li>\n</ol>\n<ul>\n  <li>t=-1: mittlere Warteschlangenl\u00e4nge E[N<sub>Q</sub>]</li>\n  <li>t=-2: mittlere Anzahl an Kunden im System E[N]</li>\n  <li>t=-3: mittlere Wartezeit E[W]</li>\n  <li>t=-4: mittlere Verweilzeit E[V]</li>\n  <li>t=-5: mittlere Erreichbarkeit 1-P(A)</li>\n</ul>";
